import Debug.Trace
import Data.Maybe

type Input = (String, String)

data OrbitTree =
      Orbiter String [OrbitTree] Int
    | Leaf String Int
    deriving (Show, Eq)

data OrbitPath =
      Part String OrbitPath Int
    | End String Int

construct :: Input -> Int -> OrbitTree
construct (orbited, orbiter) depth = Orbiter orbited [leaf] depth
    where
        leaf = Leaf orbiter (depth + 1)

constructWith :: Input -> OrbitTree -> OrbitTree
constructWith (orbited, orbiter) (Leaf name depth)
    | orbited == name = construct (orbited, orbiter) depth
    | otherwise = (Leaf name depth)
constructWith (orbited, orbiter) (Orbiter name tree depth)
    | orbiter == name = (Orbiter orbited [(Orbiter name tree depth)] (depth - 1))
    | orbited == name = (Orbiter name ((Leaf orbiter (depth + 1)) : tree) depth)
    | otherwise = (Orbiter name tree' depth)
    where
        tree' = map (\x -> constructWith (orbited, orbiter) x) tree

constructTree' input startTree =
    foldl (\tree inp -> constructWith inp tree) startTree (input)

constructTreeI :: [Input] -> OrbitTree -> [Input] -> [Input] -> OrbitTree
constructTreeI [] tree [] [] = tree
constructTreeI [] tree notUsed previousNotUsed
    | previousNotUsed == notUsed = trace (show notUsed) tree
    | otherwise = constructTreeI notUsed tree [] notUsed
constructTreeI (element:input) tree notUsed previousNotUsed =
    constructTreeI input tree' notUsed' previousNotUsed
    where
        tree' = constructWith element tree
        notUsed' = if (tree' == tree) then (notUsed ++ [element]) else notUsed

constructTree :: [Input] -> OrbitTree
-- constructTree input = constructTree' (drop 1 input) (construct (input !! 0) 0)
constructTree input = constructTreeI (drop 1 input) (construct (input !! 0) 0) [] []

