concatOrbitDepths :: OrbitTree -> [Int] -> [Int]
concatOrbitDepths (Leaf _ depth) totals = depth:totals
concatOrbitDepths (Orbiter _ tree depth) totals =
    depth:(totals ++ (concat (map (\x -> concatOrbitDepths x totals) tree)))

normalize :: [Int] -> [Int]
normalize orbitDepths = map (+ toAdd) orbitDepths
    where
        toAdd = if (smallest < 0) then (abs smallest) else 0
        smallest = foldr min 0 orbitDepths

sumOrbits tree = sum $ normalize $ concatOrbitDepths tree []

findInTree :: String -> OrbitTree -> [(String, Int)] -> [(String, Int)]
findInTree dest (Leaf name depth) path = if (name == dest) then path' else []
    where path' = path ++ [(name, depth)]
findInTree dest (Orbiter name trees depth) path = result
    where
        path' = path ++ [(name, depth)]
        result = if (name == dest)
            then path'
            else concat $ map (\x -> findInTree dest x path') trees


