findTreeWithRoot :: String -> OrbitTree -> [Maybe OrbitTree]
findTreeWithRoot rootname (Leaf name depth) = if (rootname == name) then [Just (Leaf name depth)] else [Nothing]
findTreeWithRoot rootname (Orbiter name trees depth) = result
    where
        result = if (name == rootname)
            then [Just (Orbiter name trees depth)]
            else filter (/= Nothing) $ concat $ map (findTreeWithRoot rootname) trees

pathInShared :: String -> [(String, Int)]
pathInShared dest = findInTree dest tree []
    where tree = fromJust $ (findTreeWithRoot lastEqualNode finaltree) !! 0

